// src/App.js
import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Header from "./components/containers/Header";
import {
  HomePageContainer,
  AllCampusesContainer,
  AllStudentsContainer,
  CampusContainer,
  StudentContainer,
  NewCampusContainer,
  EditCampusContainer,
  NewStudentContainer
} from "./components/containers";

function App() {
  return (
    <Router>
      <Header />   {/* 放在这里，每个路由都会显示导航 */}
      <Switch>
        <Route exact path="/" component={HomePageContainer} />
        <Route path="/campuses" component={AllCampusesContainer} />
        <Route path="/students" component={AllStudentsContainer} />
        <Route path="/campus/:id/edit" component={EditCampusContainer} />
        <Route path="/campus/:id" component={CampusContainer} />
        <Route path="/newcampus" component={NewCampusContainer} />
        <Route path="/newstudent" component={NewStudentContainer} />
        <Route path="/student/:id" component={StudentContainer} />
      </Switch>
    </Router>
  );
}

export default App;
